import React from 'react';
import { List, ListItem, ListItemText, Button } from '@mui/material';

const SupplierList = ({ suppliers, onEditSupplier, onSupplierDeleted }) => {
  return (
    <List>
      {suppliers.map((supplier) => (
        <ListItem key={supplier._id} divider>
          <ListItemText
            primary={supplier.name}
            secondary={
              <>
                <span>Contact: {supplier.contact_info}</span>
                <br />
                <span>Products Supplied: {supplier.productsSupplied.join(', ')}</span>
              </>
            }
          />
          <Button variant="contained" color="primary" onClick={() => onEditSupplier(supplier._id)}>
            Edit
          </Button>
          <Button variant="outlined" color="secondary" onClick={() => onSupplierDeleted(supplier._id)} style={{ marginLeft: '10px' }}>
            Delete
          </Button>
        </ListItem>
      ))}
    </List>
  );
};

export default SupplierList;
